import React,{ StrictMode, useState} from 'react';
import ReactDOM from 'react-dom';
import Navbar from "./navbar"
import Nxt from "./nxt"
import Inter from "./inter"
import Adder from "./adder"


function App(){

const[add, setAdd] =useState({
    val:"",
    id:""
})

function get(value,idn){
  return setAdd((prev) => {
     return prev= {value,idn}
  }) }

  return <div>
<Navbar 
key={1} 
zero={add.val} 
ind={add.id} />
<Nxt />
<Inter 
    tot={get}
/>

  </div>
}
 

export default App
